#import "ModuleMineViewController.h"
#import "NSData+Base64.h"

@interface ModuleMineViewController ()

@end

@implementation ModuleMineViewController

- (void)viewDidLoad {
    [super viewDidLoad];
    self.navigationItem.title = @"个人中心";
    NSLog(@"%s",__func__);
    
    
    UIImageView * image = [[UIImageView alloc] initWithFrame:CGRectMake(100, 100, 100, 100)];
    
    [self.view addSubview:image];
    
    
    // data:image/jpeg;base64,
    NSString * base64ImageString = @"data:image/jpeg;base64,";
    
    
    NSString *searchText = base64ImageString;
    NSError *error = NULL;
    
    //let base64Data = imgData.replace(/^data:image\/\w+;base64,/, "");
    NSRegularExpression *regex = [NSRegularExpression regularExpressionWithPattern:@"^data:image/\\w+;base64," options:NSRegularExpressionCaseInsensitive error:&error];
    NSTextCheckingResult *result = [regex firstMatchInString:searchText options:0 range:NSMakeRange(0, [searchText length])];
    if (result) {
        NSLog(@"%@\n", [searchText substringWithRange:result.range]);
        NSRange range = NSMakeRange(result.range.length, searchText.length - result.range.length);
        NSLog(@"%@\n", [searchText substringWithRange:range]);
        
        searchText = [searchText substringWithRange:range];
    }
    NSData *decodeData = [[NSData alloc] initWithBase64Str:searchText];
    image.image = [UIImage imageWithData:decodeData];
    
    
}

@end
